package Casting;

public class Cast2 { //Explicit casting conver higher data to lower data. 
	                 //There is loss of data here 5.5 to 5 in console 

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		double d = 5.5;
		
		System.out.println(d);
		
		int i = (int) d;
		System.out.println(i);

	}

}
